#                     <span class="">花芽过多的桃树,如果不合理疏花,留花过多,就会因树体积累的养分不足而导致花朵或幼果相互争夺养分,从而出现大量的无效花和自疏果,出现“满树花,半树果”的现象。为此,中国农业科学院果树研究所桃课题组针对设施桃内杂交后代花芽过多...</span>
#                         <span style="display:none;">花芽过多的桃树,如果不合理疏花,留花过多,就会因树体积累的养分不足而导致花朵或幼果相互争夺养分,从而出现大量的无效花和自疏果,出现“满树花,半树果”的现象。为此,中国农业科学院果树研究所桃课题组针对设施桃内杂交后代花芽过多的现象开展了疏花试验。结果表明,疏花后的桃树由于减少了养分的无效消耗,开花比不疏花的桃树提前5天,90株3年生桃树疏花共用2个工。</span>
