#                         <span style="display:none;">目的:探讨低氧对牦牛肺动脉平滑肌细胞(PASMCs)成纤维细胞生长因子受体2(Fibroblast growth factor receptors 2,FGFR2)表达的影响。方法:采用牦牛肺动脉平滑肌细胞(PASMCs)在37℃、1%O<sub>2</sub>、5%CO<sub>2</sub>的缺氧培养箱中生长。通过逆转录聚合酶链反应(RT-PCR)6 h、12 h、24 h、48 h和60 h检测牦牛PASMCs mRNA表达。结果:与常规培养相比,低氧6 h、12 h、60 h FGFR2的表达差异不显著,低氧24 h、48 h FGFR2的表达差异显著。结论:低氧促进牦牛PASMCs FGFR2 mRNA的表达,并随时间的增长表达量增加。</span>
