#                         <span style="display:none;">【目的】研究新疆北疆包蛋麦冬性小麦、春性小麦品种间干物质积累、灌浆特性及产量的差异。【方法】田间采用包蛋种植方式比较冬、春性小麦品种的干物质积累、灌浆特性及产量的差异。【结果】冬性品种包蛋以新冬41号产量较高,为7812.3 kg/hm<sup>2</sup>,春性品种包蛋以新春6号产量较高,为7935.6 kg/hm<sup>2</sup>。冬性品种总干物质积累量在14727.8~16983.26 kg/hm<sup>2</sup>,春性品种总干物质积累量在13588.6~17634.7 kg/hm<sup>2</sup>,冬性品种成熟期干物质积累量平均值(16140.9 kg/hm<sup>2</sup>)比春性品种(15804.1 kg/hm<sup>2</sup>)高2.09%,但冬、春性品种间差异不明显。冬性小麦品种花后同化物向籽粒分配量平均值、分配率平均值、对粒重贡献率平均值依次为4508.46 kg/hm<sup>2</sup>、57.13%、78.78%,与春性小麦品种(依次为4324.77 kg/hm<sup>2</sup>、56.36%、77.71%)均差异不明显。春性小麦品种包蛋快速增长持续时间的平均值(16.25 d)、最大灌浆速率的平均值(2.23 g/d)、平均灌浆速率的平均值(1.12 g/d),冬性小麦品种包蛋依次为15.70 d、2.22 g/d、1.09 g/d,冬、春性小麦品种之间的差异未达显著水平。【结论】新春6号、新冬41号是适合新疆北疆小麦包蛋种植方式的品种。</span>
