#                         <span style="display:none;">为了阐明短期饥饿对鲫鱼消化系统的影响,分别对饥饿胁迫0 d、5 d和10 d的鲫鱼,开展组织学、血气指标和消化酶活性研究。结果表明:短期饥饿使鲫鱼肠道绒毛高度下降且数量减少,隐窝深度和肌层厚度增加,肠道壁变薄,管腔变窄,壁皱褶变得少而浅;短期饥饿还使鲫鱼血液中的总氧气、氧分压、钠离子和钙离子下降,二氧化碳含量、二氧化碳分压、pH以及细胞外液碱剩余上升,随着饥饿时间的延长,血糖含量呈现先下降后升高的趋势,但短期饥饿对红细胞压积和血红蛋白含量未产生显著影响(P&gt;0.05);短期饥饿使鲫鱼肠道α-淀粉酶含量显著升高(P&lt;0.05),但未对肝胰脏中的脂肪酶产生显著影响(P&gt;0.05)。由此可见,短期饥饿胁迫可以使鲫鱼肠道组织学、血气指标以及消化酶活性发生适应性改变。</span>
