#                         <span style="display:none;">以265份粳稻品种为试材,分析了品种产量性状、粒型性状、穗型性状间的相关性。结果表明,13个性状变异系数在5.22%~37.70%,产量性状、粒型性状、穗型性状各性状平均变异系数分别为17.70%、14.01%、24.71%,粒型因子、粒重因子、产量因子及粒数因子是影响性状综合表现的主要因子。产量性状、粒型性状、穗型性状间存在不同程度的相关。分别对4个穗型性状与4个产量性状、4个穗型性状与5个粒型性状进行典型相关分析。结果表明,穗型性状与产量性状间的第1和第2典型相关均达到极显著水平,穗型性状中的穗长、二次枝梗数对产量性状中的穗粒数变化起主要作用;穗型性状中的穗立形状对产量性状中的穗粒数、结实率变化起主要作用。穗型性状与粒型性状间的第1典型相关达到极显著水平,穗型性状中的穗长对粒型性状中的谷粒形状变化起主要作用。</span>
