#                         <span style="display:none;">2021年上半年江西省多地反映水产养殖病害较为严重,为调查了解江西省上半年的病害发生具体情况,采取现场调研、书面调查、电话问询等多种方式,组织开展了全省水生动物疾病发生情况调研与分析。调研结果显示,以病原种类计,2021年上半年全省11个地市的主要养殖鱼类发生的水生动物疾病共计有41种,其中病毒性疾病3种,细菌性疾病18种,真菌性1种,寄生虫性疾病13种,不明原因及其他6种。上半年水产病害发生的主要特点有:老病难根除,新病种类有上升趋势,疾病发生时间有提早趋势,新发疫病有暴发流行趋势,并发症呈现普遍趋势,苗种携带疾病病原风险高。建议加强病害测报和疫病专项监测等基础性工作,加快推进实施水产苗种产地检疫,引导养殖者科学规范使用水产养殖用兽药,同时加强疾病防控技术联合攻关和推广。</span>
