#                     <span class="">海三棱藨草是我国特有的盐沼植物,也是沿海滩涂的先锋物种,具有重要的生态学价值。以海三棱藨草种子为材料,分析盐胁迫对两个不同生境(A:低潮位,海三棱藨草种群;B:中潮位,原海三棱藨草和互花米草混合群落)下海三棱藨草种群种子的种皮开...</span>
#                         <span style="display:none;">海三棱藨草是我国特有的盐沼植物,也是沿海滩涂的先锋物种,具有重要的生态学价值。以海三棱藨草种子为材料,分析盐胁迫对两个不同生境(A:低潮位,海三棱藨草种群;B:中潮位,原海三棱藨草和互花米草混合群落)下海三棱藨草种群种子的种皮开裂率及发芽的影响。结果表明,盐分是限制海三棱藨草种子发芽的主要因素,生境B种子的发芽率在同等盐浓度下要高于生境A。另外,两种生境下海三棱藨草不同颜色种皮的种子比例及种皮颜色对种皮开裂率和种子发芽率具有显著影响,生境A中黄色种子所占比例最高,生境B中棕色种子所占比例最高,且生境B中的黑色种子所占比例高于生境A。此外,黑色种子的发芽率也显著高于黄色和棕色种子,但3种颜色种子的种皮开裂率差异并不显著(p&gt;0.05)。研究表明,生境A和生境B下的海三棱藨草种子在相同盐胁迫处理下发芽率有所差异,且生境B的海三棱藨草黑色种子的占比提高,推测这是海三棱藨草对盐分升高环境的繁殖适应策略。</span>
