#                         <span style="display:none;">本文所采用的是一株分离自南极海洋淤泥的5.8S rDNA序列为蓝状菌属的真菌Penicillium citreosulfuratum(SP-9),选择芝麻和大米分别作为固体发酵营养物质,光照发酵后分别使用大孔树脂层析、硅胶层析柱、ODS层析柱、Sephadex LH-20凝胶凝胶层析柱、薄层色谱、高效液相制备色谱等分离出纯物质。根据理化性质和光谱特(1H-NMR和13C-NMR)分别鉴定为(+)-Episesamin(1),Sesaminone(2),Cyclopenin(3),Cyclopenol(4),Isoroquefortine C(5),Roquefortine C(6)。其中化合物1对鲍曼不动杆菌(Acinetobacter baumannii)的生长有明显抑菌作用。化合物2、5、6对藤黄微球菌(Micrococcus luteus)有明显的抑菌作用,化合物1、3对大肠杆菌(Escherichia coli)和绿脓杆菌(Pseudomonas aeruginosa)有明显抑菌作用。</span>
