#                     <span class="">目的探讨冠心病患者临床特征、外周微循环状态与冠状动脉病变程度的关系。方法选取我院2016年3月-2021年3月220例冠心病患者作为研究对象,根据冠状动脉病变程度将患者分为轻、中度组(n=142)和重、极重度组(n=78)。收集两组入院时年龄、...</span>
#                         <span style="display:none;">目的探讨冠心病患者临床特征、外周微循环状态与冠状动脉病变程度的关系。方法选取我院2016年3月-2021年3月220例冠心病患者作为研究对象,根据冠状动脉病变程度将患者分为轻、中度组(n=142)和重、极重度组(n=78)。收集两组入院时年龄、性别、身体质量指数(BMI)、糖尿病、高血压各项信息。测定两组入院1 d后叶酸(FA)、维生素B<sub>12</sub>(VB<sub>12</sub>)、总胆红素(TBIL)、甘油三酯(TG)、总胆固醇(TC)、高密度脂蛋白胆固醇(HDL-C)、低密度脂蛋白胆固醇(LDL-C)水平。采用手指复温试验测定患者外周微循环。对比两组基础资料、实验室指标及手指复温时间(RT),利用ROC曲线分析FA、VB<sub>12</sub>、TBIL、TC、LDL-C、RT对冠心病患者重、极重度冠状动脉病变发生的预测价值,将有差异的单因素纳入Logistic模型,行量化赋值,明确冠心病患者重、极重度冠状动脉病变发生的危险因素。结果重、极重度组年龄≥60岁、高血压患者占比显著高于轻、中度组,FA、VB<sub>12</sub>、TBIL水平显著低于轻、中度组,TC、LDL-C、RT显著高于轻、中度组,差异均有统计学意义(P&lt;0.05)。FA、VB<sub>12</sub>、TBIL、TC、LDL-C、RT预测冠心病患者重、极重度冠状动脉病变发生的曲线下面积分别为0.931、0.732、0.869、0.849、0.775、0.967,均P&lt;0.05。经多因素Logistic回归分析证实,年龄≥60岁、高血压、FA≤6.555μg/L、VB<sub>12</sub>≤268.295 ng/L、TBIL≤10.015μmol/L、TC≥5.015 mmol/L、LDL-C≥2.680 mmol/L、RT≥405.240 s是冠心病患者重、极重度冠状动脉病变发生的危险因素。结论年龄≥60岁、高血压患者发生重、极重度冠状动脉病变可能性较大,患者FA、VB<sub>12</sub>、TBIL、TC、LDL-C水平及外周微循环与冠状动脉病变程度密切相关,可用于评估患者病情严重程度。</span>
