#                     <span class="">目的:针对乳腺癌容积旋转调强放射治疗(VMAT)计划,比较“Auto-Flash”功能和“假组织补偿法”两种射野边界外扩方法的剂量学差异,并评价其外扩效果。方法:选取医院收治的20例女性乳腺癌保乳术后患者,在对患者所有的VMAT计划中分别采用“...</span>
#                         <span style="display:none;">目的:针对乳腺癌容积旋转调强放射治疗(VMAT)计划,比较“Auto-Flash”功能和“假组织补偿法”两种射野边界外扩方法的剂量学差异,并评价其外扩效果。方法:选取医院收治的20例女性乳腺癌保乳术后患者,在对患者所有的VMAT计划中分别采用“Auto-Flash”功能和“假组织补偿法”进行射野边界的外扩,并根据两种皮肤通量射野边界方法外扩设计A-VMAT和P-VMAT两种治疗计划。评估两种计划的射野边界外放效果,靶区和危及器官(OAR)的剂量学参数,计划的执行效率及计划的剂量验证通过率。结果:在射野方向观察胸廓外放射野效果,两种计划的通量均已在胸廓方向外放到皮肤以外。A-VMAT和P-VMAT计划的靶区均匀性指数(HI)分别为0.07&#177;0.011和0.08&#177;0.002,差异有统计学意义(t=-5.661,P&lt;0.05)。靶区适形指数(CI)差异无统计学意义。A-VMAT和P-VMAT计划靶区的98%靶区体积所受照射剂量(D<sub>98</sub>)分别为(5007.25&#177;34.79)cGy和(4973.43&#177;44.57)cGy,D<sub>2</sub>分别为(5363.87&#177;34.16)cGy和(5393.95&#177;40.86)cGy,两种计划比较差异有统计学意义(t=3.465,t=-4.248;P&lt;0.05)。靶区的D<sub>50</sub>和平均剂量(D<sub>mean</sub>)以及主要OAR的剂量学参数基本相似,差异无统计学意义,且均能满足临床要求。结论:在乳腺癌保乳术后的VMAT计划中,采用“Auto-Flash”功能和“假组织补偿法”均能实现射野边界的有效外扩,且靶区剂量和OAR受量均能满足临床要求。“假组织补偿法”的射野边界外扩方法,可为尚无射野边界自动外扩功能的计划系统进行乳腺癌VMAT计划设计提供参考。</span>
