#                         <span style="display:none;">刚体的构形可用其质心位置和姿态矩阵描述.刚体的位置可以在欧几里得空间中表示,但是其姿态矩阵是在李群上演化的.由于李群独特的非线性性质,基于欧氏空间的多体动力学建模与数值算法难以完全真实地描述系统的动力学特性,特别是长时间历程的动力学特性.本文基于几何力学理论,首先根据离散Hamilton变分原理与离散Legendre变换,建立了多刚体系统的Hamilton体系李群变分积分公式.其次,给出李群变分积分公式的两种离散格式:一般离散格式和RATTLie离散格式.最后,采用这两种不同离散格式构建的算法计算了重力作用下空间刚体双摆的动力学问题,对比研究了算法在保持系统群结构、系统能量等方面的性质.计算结果表明,RATTLie离散格式较一般格式精度更高,且能更好地保持系统群结构与能量.</span>
