#                         <span style="display:none;">为阐明近场地震速度脉冲效应对周期较长的钢框架抗震性能的影响规律,采用增量动力分析(IDA)方法,对符合我国现行设计规范的三个不同设防水平的钢框架结构进行了地震易损性分析,并对比分析了其在近、远场地震下的地震易损性差异。结果表明:近场地震作用的速度脉冲效应将放大钢框架结构的动力响应,并增大其概率地震需求模型的不确定性;相同地震强度下,近场地震作用的速度脉冲效应将增大钢框架结构的损伤破坏概率,且周期较长的低设防水平钢框架结构在近场地震作用下更易损伤破坏;鉴于近场地震对钢框架结构地震易损性的显著影响,建议评估钢框架结构的震害风险时,应针对近场和远场地震作用分别建立易损性模型。</span>
