#                         <span style="display:none;">以2-(2′-羟基-5′-甲基苯基)苯并三唑(UV-P)和丙烯酰氯为原料合成2-(2′-丙酰氧基-5′-甲基苯基)苯并三唑(AMB),使其与低密度聚乙烯(LDPE)、过氧化二异丙苯(DCP)熔融共混,经交联固化使AMB接枝到PE大分子链上,得到AMB接枝的交联聚乙烯材料(AMB-g-XLPE)。测试了纯XLPE、UV-P/XLPE和AMB-g-XLPE的耐抽提性、凝胶含量、交流击穿场强、电树引发电压和相对介电常数等。实验结果表明,化学接枝能极大程度改善小分子化合物的耐抽提能力;当AMB和UV-P的质量分数为0.2时,相比纯XLPE,AMB-g-XLPE的交流击穿场强提高16.27%,达到63.16 kV/mm,UV-P/XLPE的交流击穿场强提高至60.19 kV/mm;同时二者都能提高XLPE的电树引发电压。</span>
