#                         <span style="display:none;">为了探讨制备碳纳米管纤维的直立式气相沉积反应器气体流场,选用计算流体力学软件Gambit和Fluent分别对直立式气相沉积反应器气体流场进行建模和数值模拟,模拟得到反应器内部气体速度、温度和浓度分布。结果表明:气体从进气管口射出时速度达到峰值1.79 m/s;在加热段时速度逐渐趋向于稳定,为0.02 m/s,温度逐渐趋向于反应器管壁温度(1500 K);碳源甲烷气体在反应器加热段呈现泊肃叶分布。直立式气相沉积反应器加热段气体流场呈现低速平缓高温,是适宜碳纳米管合成和碳纳米管纤维形成的有利环境和主要区域。</span>
