#                         <span style="display:none;">研究附加阻尼器的核筒悬挂体系,利用静力弹塑性分析方法将结构简化为质点系模型,并利用自编程序对四种结构进行地震响应分析。结果表明:在主结构和子结构之间附加金属阻尼器后,不但减小了主结构和子结构的绝对位移,也有效地减小了主结构和子结构之间的相对位移,避免发生结构间的碰撞;在子结构和子结构之间附加金属阻尼器后,同层子结构之间相对位移变小;在主结构和子结构以及子结构和子结构之间同时附加金属阻尼器后,主结构和子结构的绝对位移均明显减小,主结构和子结构之间的相对位移以及同层子结构之间的相对位移也都明显变小。</span>
