#                         <span style="display:none;">加气混凝土作为一种新型建筑材料,其结构与性能受原材料组成及配合比等多方面的影响。基于国内外近年来对加气混凝土的研究现状,简述了组成加气混凝土的胶凝材料种类、外加剂种类及掺量、养护方式的选择对加气混凝土性能的影响,并对力学性能、热工性能等基本性能进行分析概述。针对目前加气混凝土强度较低、养护成本大等问题,提出了加气混凝土未来的发展方向,如利用矿渣、硅锰渣、钢渣等工业固体废弃物制备免蒸压加气混凝土,为加气混凝土在建筑行业中能够更好地应用提供一定的参考。</span>
