#                         <span style="display:none;">为推进河西走廊地区肉羊产业发展,采用查阅资料、入户调查及数据汇总等方法对武威、金昌、张掖、酒泉、嘉峪关2016—2020年肉羊产业发展情况进行调研。结果表明:2016—2020年,河西走廊地区肉羊产业发展总体呈增长趋势,武威、张掖、嘉峪关肉羊饲养量出现大幅增长,金昌增幅不明显,酒泉出现下降;河西走廊地区肉羊良种化程度较低,羊肉产品质量有差异,科技水平滞后于迅速扩张的养殖规模。因此,应完善羊肉产品质量追溯体系,引进、培育肉羊新品种,并做好品牌的建设与推广工作,从而促进肉羊产业持续向好发展。</span>
