#                         <span style="display:none;">伴随着中国经济高质量发展和人民群众对生活质量诉求的显著提升,市场整体对出行质效要求已上升到一个新高度,届时,高铁、航空并行发展,快速进入快车道时期。而其中,航空运输属于我国交通运输体系中的关键一翼,尤其是近年来,航空运输业依靠自身高效、优质等行业特点,在现代化的交通体系中展现关键价值,极大便利民众出行,产业发展与未来建设空间更较为理想。但近两年国际经济局势呈现出的逆全球化发展趋势,使得航空运输行业的整体局势不容乐观。加之高铁、高速公路等运输网络的全面铺开,使中国航空产业发展面对多方冲击,同时航空运输行业本身就属于技术、劳动、资金密集型产业,&quot;高风险、高投入、低收益&quot;的特点极为明显,尤其是飞机租赁问题,租赁成本成为制约航空企业的关键主板。因此,只有合理权衡好经营与融资租赁间的协同关系,才能一定程度上达成新时期下航空企业的质效升级。故本文选取航空企业飞机融资租赁中的主要风险点为基础,对风险点展开论述,并针对风险隐患,提出对策建议,望能助力新时期下航空企业向好发展。</span>
