#                         <span class="">为建立垂丝海棠组培快繁体系,对垂丝海棠最适外植体、外植体消毒方法、腋芽萌发、增殖培养、生根培养及移栽驯化进行了研究。结果表明,以春梢嫩枝茎段为外植体,70%乙醇消毒30 s+2%有效氯次氯酸钠溶液消毒处理12 min,外植体污染率仅1.11%,死亡率仅2.22%,存活率高达96.67%;腋芽萌发与生长最适培养基为WPM+10 mg/L GA<sub>3</sub>;最适增殖培养基为WPM+0.5 mg/L IAA,有效增殖系数为4.57;最适生根培养基为WPM+0.25 mg/L NAA,生根率可达92.22%,平均根条数5.84条;生根后移栽到草炭∶蛭石∶珍珠岩=1∶1∶1的基质中,存活率达95.56%。</span>
