#                 <span class="label">摘要</span><span class="abstract">
#                         <span class="">异源附加系是克服植物远缘杂交障碍和开展遗传研究的中间材料,可用于基因定位、构建外源渐渗系群体、创新种质资源、开展外源染色体配对和重组等研究。着重阐述了构建作物异源附加系的常规法、桥梁法、双重单体或多重单体附加法、单倍体法、回交法、细胞融合法、自交法,对异源附加系的形态学鉴定、原位杂交、细胞学鉴定、分子标记鉴定方法和异源附加系在基因定位、种质资源创新的应用等方面的研究进展,对异源附加系的研究现状进行了总结,以期为作物野生资源的利用提供参考。</span>
