#             <dd>
#                 <span class="label">摘要</span><span class="abstract">
#                         <span class="">为探究熊蜂传粉对设施甜瓜的提质增效作用,以网纹甜瓜为材料,比较了熊蜂传粉与植物生长调节剂氯吡脲(CPPU)喷花对塑料大棚甜瓜坐瓜率、畸形瓜率、糖含量、酸含量、风味物质含量、667 m<sup>2</sup>产量及667 m<sup>2</sup>收益的影响。结果表明,熊蜂传粉甜瓜的坐瓜率平均可达94.17%,与CPPU喷花无显著差异,并可降低畸形瓜率。相比CPPU喷花,熊蜂传粉可显著提高甜瓜的蔗糖含量、酸含量与可溶性固形物含量,亦可显著提高乙酸己酯、乙酸3-乙酰氧基丁-2-基酯、2-甲基丁基乙酸酯、正己醇等重要香味物质含量,并产生特有的芳香物质β-紫罗兰酮及正庚醇。与CPPU喷花相比,熊蜂传粉甜瓜产量有所降低,但其风味佳、品质优,使得每667 m<sup>2</sup>收益较CPPU喷花可提高约8.01%。综上所述,熊蜂传粉可替代植物生长调节剂喷花,具有明显的提质增效作用,可作为设施甜瓜绿色高质量发展的重要配套技术。</span>
#
