#                                     <span><span>江西省农业农村厅2021年度农牧渔业科研指导性课题项目:江西地区小龙虾病原监测与绿色防控技术研究(项目编号29)</span></span>
#                                     <span><span>2022年度江西省特种水产产业技术体系加工与虾蟹养殖岗。</span></span>
