#             <dd>
#                 <span class="label">摘要</span><span class="abstract">
#                         <span class="">聪绿果实蝇饵剂具有诱杀机理独特、专一性强、使用简单方便、防治效果良好等优点,为了进一步明确其在蜜桃果园上对橘小实蝇的防治效果和使用技术,2020年6—7月在平乐县长滩湾鹰嘴桃种植旅游专业合作社果园进行了聪绿果实蝇饵剂防治鹰嘴桃橘小实蝇的田间药效试验。结果表明,聪绿果实蝇饵剂对蜜桃橘小实蝇有良好的防治效果,高于当前农户广泛使用的农药树冠喷雾+实蝇粘胶板常规防治处理,且安全性高,成本降低,绿色环保,可有效保证农产品质量安全,利于推进农药减量控害,应该在生产上大面积推广应用。</span>
