#                         <span class="">近日,经国家有关部门专家测试,来自大连培训基地的导盲犬,可以提供给视障运动员使用。该批导盲犬于3月4日至13日亮相在北京举办的冬残奥会,在冬奥会上展现自己的实力与风采。从2019年12月份开始,经过两年时间的艰辛努力,中国导盲犬大连培训基地在时间紧、任务重的情况下提前超额成功培训出适用于复杂、严寒环境条件,并能够引领视障运动员独立自主出行的导盲犬68头,比原定任务数量超出48头。</span>
