#                 <span class="label">摘要</span><span class="abstract">
#                         <span class="">为了解国内梨形环棱螺(Bellamya purificata)群体的遗传特征,利用7对微卫星引物对山东微山湖、江苏高邮湖、上海明珠湖、浙江淳安、安徽黄陂湖、湖北长湖、江西仙女湖、湖南耒水、贵州夜郎湖、广西千亩湖、广东榕江11个群体的遗传多样性和遗传结构进行了分析。结果显示:观察杂合度(Ho)为0.434~0.674,期望杂合度(He)为0.772~0.905,多态性信息含量(PIC)为0.756~0.885,这11个群体的遗传多样性均较高。遗传变异中有94.84%来自群体内,5.16%的遗传变异来自群体间,群体间的遗传分化程度较低(F<sub>st</sub>=0.052)。浙江淳安群体和江苏高邮湖遗传距离最远。</span>
