#                         <span class="">近日,湖北省民政厅印发《关于建立社会组织登记管理信用承诺制度的通知》.对社会组织诚信承诺制度建设作出安排部署。湖北省民政厅相关负责人介绍,在全省探索建立社会组织登记管理信用承诺制度,是创新社会治理的有效途径和促进社会组织高质量发展的重大举措,是强化社会组织自律意识、提升社会组织公信力的重要手段,是全省社会信用体系建设的重要组成部分。</span>
