#             <dd>
#                 <span class="label">摘要</span><span class="abstract">
#                         <span class="">村党组织书记“一肩挑”制度是适应乡村振兴和乡村治理的需要、确保村党组织领导核心地位所作的一个创新性的制度设计。它有利于减少村级职位、减轻基层负担,减少村两委的矛盾。但“一肩挑”模式下村党组织书记还存在工作压力大、用权风险大、村级创收难、上届遗留多和党建文牍化严重等问题。希望通过营造良好的身心健康环境、形成对“一肩挑”书记监督的合力、因村制宜选路子壮大村级集体经济、强化教育培训等举措以提升“一肩挑”书记和其他干部的综合素质形成党建合力,为乡村振兴奠定基础。</span>
