#                         <span class="">在疫情海啸给予全球电影产业重创的当下,中国电影却以非凡的坚韧走向了快速复苏。在光影回归的潮流之中,由湖北独立或参与制作的一系列“湖北造”影片表现十分亮眼。近年来,注重商业价值的类型电影、承担教育功能的红色影片和蕴含哲思艺韵的小众艺术电影并进发展,收获可喜票房成绩的同时,也赢得了国内外的多个重要奖项,表现出对艺术关怀和文化品位的自觉追求。</span>
