#                 <span class="label">摘要</span><span class="abstract">
#                         <span class="">黄梅戏自滥觞起就形成了反映现实生活、表达民众心声的传统,以及尚柔尚朴、自由灵动、浪漫抒情的美学品格、旦角为主、生旦丑并置、载歌载舞、广纳博取的剧种特性。一批黄梅戏现代戏在现实主义精神的贯注、剧诗品格的追求、现代性等方面大大拓展了自身的美学品格,但仍存在对社会生活表层化、概念化的表达,选材及艺术处理上同剧种特性相错位和非戏曲化的倾向,其根本原因在于创作者忽视了该剧种的美学品格和现代观众的审美期待。</span>
