#             <dd>
#                 <span class="label">摘要</span><span class="abstract">
#                         <span class="">目的探讨炎症指标hs-CRP及端粒长度(TL)与AD病人认知功能的相关性,比较不同TL下认知量表各认知域损害特点。方法选择老年病人共135例,分为正常对照组(NC组,n=49)和AD组(n=86),采集人口学及一般临床资料,抽取静脉血检测hs-CRP水平,提取外周血白细胞DNA测定TL,对入组人群评估MoCA评分。比较2组hs-CRP、TL、认知功能等方面的差异,并进一步将AD组按照TL三分位数进行分组,分析各亚组认知域之间的差异。结果AD组TL短于NC组(P&lt;0.01),而hs-CRP水平高于NC组(P&lt;0.05)。2组年龄、教育年限、DBP、HbA1c、Hcy、MoCA评分差异有统计学意义。Logistic回归分析显示hs-CRP、血Hcy、TL缩短是AD的独立危险因素。AD病人中短端粒组较长端粒组在视空间与执行力、注意力、计算能力、抽象和记忆力方面的认知损害更明显。结论慢性炎症、TL缩短是AD的可能危险因素,TL与认知域损害可能存在线性关系。</span>
