#             <dd>
#                 <span class="label">摘要</span><span class="abstract">
#                         <span class="">目的观察莪术愈创木烷型倍半萜化合物改善高脂饲料ApoE-/-小鼠脂质代谢和肝脏细胞脂肪变性的作用。方法8周龄SPF级雄性ApoE-/-小鼠30只,随机分为模型组、倍半萜治疗组(10 mg/kg)和阿托伐他汀治疗组(10 mg/kg);同源C57/BL6小鼠10只,作为正常对照组。模型组和正常对照组给予等体积生理盐水灌胃。各组小鼠干预12周,称重,麻醉取血,处死动物,检测血脂水平和肝功能等;肝脏切片油红O染色,观察肝脏脂肪滴含量;HE染色观察肝细胞损伤的程度;免疫组化检测肝脂酶(hepatic lipase,LIPC)蛋白表达的水平。结果实验12周时,和正常对照组相比,模型和各给药组小鼠体质量变化无统计学差异。与正常对照组小鼠相比,模型组小鼠总胆固醇(total cholesterol,TC)、甘油三酯(triacylglycerol,TG)、低密度脂蛋白胆固醇(low-density lipoprotein cholesterol,LDL-c)明显升高(P&lt;0.01);与模型组相比,倍半萜组和阿托伐他汀组小鼠TC和LDL-c明显下降(P&lt;0.01)。与正常对照组相比,模型组小鼠肝脏细胞大量脂滴形成、排列紊乱;倍半萜和阿托伐他汀组肝细胞脂滴减少,排列整齐。与正常对照组相比,模型组小鼠谷丙转氨酶(alanine aminotransferase,ALT)、谷草转氨酶(aspartate aminotransferase,AST)和碱性磷酸酶(alkaline phosphatase,AKP)水平明显升高(P&lt;0.05);与模型组相比,倍半萜组ALT、AST明显下降(P&lt;0.01),阿托伐他汀治疗组降低不明显(P&gt;0.05)。和模型组相比,倍半萜组小鼠肝脏LIPC蛋白表达明显升高(P&lt;0.05)。结论倍半萜可改善高脂饮食ApoE-/-小鼠脂质代谢紊乱,抑制肝脏细胞脂肪变性,减轻肝细胞损伤,其机理可能与升高LIPC蛋白表达有关。</span>
#
#                     </span>
