#                         <span class="">咳嗽是生活中非常常见的一种症状,有声无痰为“咳”,有痰无声为“嗽”,有痰有声就称为“咳嗽”。临床上多是痰、声并见,故以咳嗽并称。《黄帝内经&#183;素问》中提到:“五脏六腑皆令人咳,非独肺也。”也就是说,咳嗽病因复杂,五脏六腑出现问题都可能引起咳嗽,不单单是肺的问题。因此,对于咳嗽,应辨证分析,对症治疗。</span>
