#                 <span class="label">摘要</span><span class="abstract">
#                         <span class="">分析人工泪液治疗白内障术后干眼症的临床效果。选取64例白内障术后干眼症患者为研究对象,对照组未应用人工泪液治疗,实验组应用人工泪液治疗,比较两组的疗效。实验组治疗3个疗程后,泪液分泌检查(SIT)、泪膜破裂时间检查(BUT)等相关检查结果均显著优于对照组,差异有统计学意义(P&lt;0.05)。实验组治疗3个疗程后的治疗总有效率显著高于对照组,差异有统计学意义(P&lt;0.05)。对白内障术后干眼症患者进行人工泪液治疗可显著提升其临床效果。</span>
