#                 <span class="label">摘要</span><span class="abstract">
#                         <span class="">甘草又名国老、粉草,是我国中草药中应用最多的药物,因味甘甜而得名,素有“百搭之王”的雅号。早在两千多年前,我国现存最早的药物学专著《神农本草经》中就有记载有甘草,并将其列为药中“上品”,曰:“甘草,味甘,平。主五脏六腑寒热邪气。坚筋骨,长肌肉,倍力,金疮,解毒。久服轻身,延年。”明代李时珍在《本草纲目》中,将甘草列为“草部”之首。由此可知,甘草入药已有悠久的历史,且为常用要药。药谚云:“十方九甘草。”</span>
