#                         <span class="">架空线的高压柔性直流孤岛供电系统故障率较高,配置直流断路器(Direct CurrentCircuit Breaker,DCCB)隔离故障是有效的解决方案之一。文章提出一种适用于高压柔性直流孤岛供电系统的直流故障穿越协调控制策略。策略将故障后的系统工况划分为自平衡和非自平衡工况,分别进行控制设计。结果表明,协调控制策略能够在故障隔离后维持孤岛系统交流电压的稳定与功率平衡,有效提高高压柔性直流输电孤岛供电系统直流故障穿越能力。</span>
