#                 <span class="label">摘要</span><span class="abstract">
#                         <span class="">近些年,我国城市空间布局发展呈现出一些不合理的状况,主要表现为:一方面,围绕生产需求扩张性地建设大量空间,存在总量大、品质低的问题,造成今天城市拥堵,环境品质下降;另一方面,严重忽视了人们生活所需的空间,造成欠账很多。不仅如此,我们的城市管理者已经形成了思维定式和行为惯性,习惯于大拆大建,忽视品质建设和空间治理。面对新形势,我们应该如何转变认识、改变行为,建设出令人民满意的城市空间?对此,本文以南京市鼓楼区为例,进行了研究分析。</span>
