#                 <span class="label">摘要</span><span class="abstract">
#                         <span class="">我国已经迈入老龄化社会,老年人生活空间及其质量在快速城镇化过程中遭到严重挤压,尤其是老年人步行空间和行为大幅减少。因此本文选择老年人步行范围——社区为研究范围,总结现有老年人步行行为与社区环境之间的研究进展,并对未来研究方向进行展望,从关注步行行为特征到步行行为的社会意义,从关注社区软环境到社区软硬环境,从关注两者的单向作用到构建互动反馈框架,以期对老年友好型城市建设提出理论指导。</span>
