#                 <span class="label">摘要</span><span class="abstract">
#                         <span class="">国六阶段天然气发动机采用三元催化转化器和理论空燃比相结合的技术路线。与国五阶段稀薄燃烧相比,缸内热负荷和爆震显著增加,燃气消耗量也出现明显增加。为改善天然气发动机热负荷和爆震,提高燃气经济性,天然气发动机引入了废气再循环系统。天然气主要成分是甲烷,燃烧后发动机尾气中水分含量较高,在极寒环境下,废气经废气再循环系统冷却器冷却进入进气系统后,可能出现废气再循环阀、燃气混合器、节气门等部位结冰的潜在失效模式。文章介绍增加废气再循环系统后出现结冰现象的原因、车辆运行表现和寒区试验验证部件,提前识别可靠性风险,保证车辆在极寒环境下可靠运行。</span>
