#                 <span class="label">摘要</span><span class="abstract">
#                         <span class="">在转向系统性能测试中,通常是采用力矩方向盘对转向力矩进行测试,但此方案试验准备时间长,设备安装拆卸复杂,故提出一种利用控制器局域网络上的电动助力转向管柱发送的报文来测量方向盘转向力的简便方法。文章基于电动助力转向管柱自带的转角传感器和扭矩传感器对方向盘转角和转向力进行测量,并通过整车控制器局域网络上的报文对数据进行采集,得到多工况转向时方向盘转向角度和转向力之间的关系,结果表明转向力矩较小,符合转向性能要求。通过力矩方向盘和控制器局域网络报文测试两种方法测试结果对比可知,两者测量值误差较小,趋势一致,说明利用控制器局域网络报文对转向力进行测试的方法,是可行可靠、准确的。通过控制器局域网络报文的测试方法还可减少测试成本、缩短车型开发周期。</span>
