#                 <span class="label">摘要</span><span class="abstract">
#                         <span class="">黄河流域生态一直面临水土流失严重、土地沙化加剧、自然资源开采过度、野生动物急剧减少、土壤盐碱化严重等问题,引起了国家和研究机构的高度重视,众多学者围绕这些问题展开了研究,也取得了众多研究成果,但未见对这些研究成果进行系统性、定量定性的分析,不能很好地服务于“黄河高质量发展”。针对该问题,文章基于CNKI期刊库核心论文和Web of Science核心合集期刊和会议论文,从文献计量角度,采用NoteExpress文献管理软件和CiteSpace可视化软件,以知识图谱的方式系统全面、定性定量地分析了黄河流域生态研究的整个发展过程、研究重点、核心作者及其主要研究群体。</span>
