#                         <span class="">近日,由平顶山市自然资源和规划局建设的“多测合一”信息服务平台上线试运行,实现了工程建设项目竣工验收阶段“多测合一”业务全流程网上一体化管理。推进工程建设项目“多测合一”改革是贯彻落实党中央、国务院深化“放管服”改革和优化营商环境的重要内容。针对工程建设项目竣工验收阶段存在的重复测绘、要求标准不一、成果不能共享等现状,该局积极推进“多测合一”改革,编制完成《平顶山市工程建设项目“多测合一”管理办法(试行)》,明确“多测合一”的实施范围、坐标基准、部门职责、实施程序等。</span>
