#                         <span class="">“三农”工作是全面建设社会主义现代化国家的重中之重。“十三五”时期,我国加快推进现代农业建设,832个贫困县全部摘帽,12.8万个贫困村全部出列,农业科技进步贡献率超过60%,乡村振兴实现良好开局。目前,我国农业农村发展仍面临不少矛盾和挑战,如耕地质量退化面积较大、农业质量效益和竞争力不强、脱贫地区产业发展基础仍然不强等。</span>
