#                         <span class="">大型科技公司积累了庞大的客户群体,囤积了大量数据,利用这些数据为客户提供金融服务。大数据分析、网络外部性及交互活动是大型网络科技公司商业模式的关键特征。需求因素和供给因素共同驱动了大型科技公司金融服务的兴起。大型科技公司的金融服务在方便客户的同时也加大了风险传播的可能性,对其监管上应坚持监管一致性原则,强化数据管理和隐私保护,防止金融数据的垄断。</span>
