#             <dd>
#                 <span class="label">摘要</span><span class="abstract">
#                         <span class="">在“十四五”规划下,管理金融风险,提高企业投资效率仍是经济工作中的重点。近年来,在去杠杆的浪潮下,也涌现出了大量零杠杆企业。本文主要以案例研究法,以东阿阿胶为例,探究企业零杠杆对其投资效率的影响。研究发现,东阿阿胶在缺乏外部债权人的监督以及对管理层激励不足的双重作用下产生非效率投资。同时面临经营成本上升,渠道阻塞,经营环境变化等问题导致企业现金流减少。东阿阿胶亟待战略转型升级,因此现有的资本结构已经无法满足企业转型升级需要,东阿阿胶应优化其融资结构,减少企业非效率投资。</span>
